Me enorgullece unirme a UNITE HERE Local 23 para exigir salarios completos, apoyo y beneficios para los trabajadores de servicios de alimentación de nuestra Cámara.

Mientras los subcontratistas vienen y van, estos trabajadores garantizan los servicios de alimentación para los miembros del Congreso, el personal y los visitantes de nuestro campus, y necesitan nuestro apoyo ahora más que nunca.

@unitehere23

I’m proud to stand with UNITE HERE Local 23 to demand full wages, support and benefits for our House food service workers. 

As subcontractors come and go, these workers ensure food services for Members, staff and visitors to our campus, and they need our support now more than ever.

@unitehere23

El cambio climático es una realidad, y sus impactos innegables, y a veces mortales, se observan en comunidades de todo el país y del mundo.

Invertir en el Fondo Verde para el Clima preservaría la reputación de Estados Unidos como líder mundial en la lucha contra el cambio climático.

@AppropsDems

Climate change is certain, and its undeniable and sometimes deadly impacts are witnessed in communities around our nation and the world.

Investing in the Green Climate Fund would preserve the United States’ reputation as a global leader in fighting climate change.

@AppropsDems https://t.co/16FCp0f6Ee

